import React from 'react';
import styles from './CasePage.module.css';


export default function CasePage() {
  return (
    <>
      <header className="header">
        <img src="images/logosmall.png" alt="IdeaFlow logo" style={{ height: 80 }} />
        <nav className="navLinks">
          <a href="#profile">Профиль</a>
          <a href="#cases">Кейсы</a>
          <a href="#projects">Проекты</a>
          <button className="buttonYellow">Разместить проект</button>
          <button className="buttonYellow">Приступить к проекту</button>
        </nav>
      </header>
      {/* Добавьте остальную разметку страницы здесь */}
    </>
  );
}
